// src/components/Sidebar.js
import React from "react";
import "./Sidebar.css";
import { FaHome, FaBook, FaFlask, FaFileAlt, FaAward, FaLightbulb, FaCog } from "react-icons/fa";

export default function Sidebar() {
  return (
    <div className="sidebar">
      <h2 className="sidebar-title">InnovateHub</h2>

      <ul className="sidebar-menu">
        <li><FaHome /> Dashboard</li>
        <li><FaBook /> Research Papers</li>
        <li><FaLightbulb /> Startup Activities</li>
        <li><FaFileAlt /> Publications</li>
        <li><FaFlask /> Grants & Funding</li>
        <li><FaAward /> Recognition & Awards</li>
        
      </ul>
    </div>
  );
}
